import React, { useEffect, useRef } from 'react';
import SwiperCore, { Parallax } from 'swiper';
import 'swiper/css';
import 'swiper/css/parallax';
import { Swiper, SwiperSlide } from 'swiper/react';

import image1 from "../images/page1.jpg";
import image2 from "../images/page2.jpg";
import image3 from "../images/page3.jpg";

SwiperCore.use([Parallax]);

export default function CarouselComponent() {
  const parallaxRef = useRef(null);

  useEffect(() => {
    if (parallaxRef.current) {
      parallaxRef.current.update();
    }
  }, []);

  return (
    <Swiper
      parallax={true}
      parallaxEl={parallaxRef.current}
      speed={600}
      className="mySwiper"
      style={{ width: "90vw", height: "90vh" }}
    >
      <SwiperSlide style={{ backgroundImage: `url(${image1})` }}>
        <div className="swiper-parallax">
          {/* Your content for the first slide */}
        </div>
      </SwiperSlide>
      <SwiperSlide style={{ backgroundImage: `url(${image2})` }}>
        <div className="swiper-parallax">
          {/* Your content for the second slide */}
        </div>
      </SwiperSlide>
      <SwiperSlide style={{ backgroundImage: `url(${image3})` }}>
        <div className="swiper-parallax">
          {/* Your content for the third slide */}
        </div>
      </SwiperSlide>
    </Swiper>
  );
}
